import React from 'react';
import './SmallCard.scss'
const SmallCard = () => {
    return (
        <div className="small-card">
            <img/>
            <h5>Imprezy okolicznościowe</h5>
            <p>Przed Tobą chrzest , Jubileusz lub rocznica ślubu? Każde przyjęcie przygotujemy jak </p>
        </div>
    );
};

export default SmallCard;
